package db.domain;import java.util.Arrays;public class LogLoginImpl implements LogLogin {	@Key	private int logId;	private String uname;	private String nick;	private int loginTime;	private int type;	public LogLoginImpl() {	}	public LogLoginImpl(LogLogin c) {		this.logId = c.getLogId();		this.uname = c.getUname();		this.nick = c.getNick();		this.loginTime = c.getLoginTime();		this.type = c.getType();	}	@Override	public String tableName() {		return "log_login";	}	public void setLogId(int logId) {		this.logId = logId;	}	public int getLogId() {		return this.logId;	}public void addLogId(int logId) {		this.logId += logId;}	public void setUname(String uname) {		this.uname = uname;	}	public String getUname() {		return this.uname;	}public void addUname(String uname) {		this.uname += uname;}	public void setNick(String nick) {		this.nick = nick;	}	public String getNick() {		return this.nick;	}public void addNick(String nick) {		this.nick += nick;}	public void setLoginTime(int loginTime) {		this.loginTime = loginTime;	}	public int getLoginTime() {		return this.loginTime;	}public void addLoginTime(int loginTime) {		this.loginTime += loginTime;}	public void setType(int type) {		this.type = type;	}	public int getType() {		return this.type;	}public void addType(int type) {		this.type += type;}}